r Zonal." }, "recommended": { "type": "boolean", "description": "Whether the location is recomended for GKE cluster scheduling." }, "name": { "description": "Contains the name of the resource requested. Specified in the format `projects/*/locations/*`.", "type": "string" } }, "type": "object", "id": "Location" }, "UsableSubnetwork": { "type": "object", "description": "UsableSubnetwork resource returns the subnetwork name, its associated network and the primary CIDR range.", "properties": { "ipCidrRange": { "type": "string", "description": "The range of internal addresses that are owned by this subnetwork." }, "network": { "description": "Network Name. Example: projects/my-project/global/networks/my-network", "type": "string" }, "subnetwork": { "description": "Subnetwork Name. Example: projects/my-project/regions/us-central1/subnetworks/my-subnet", "type": "string" }, "statusMessage": { "description": "A human readable status message representing the reasons for cases where the caller cannot use the secondary ranges under the subnet. For example if the secondary_ip_ranges is empty due to a permission issue, an insufficient permission message will be given by status_message.", "type": "string" }, "secondaryIpRanges": { "description": "Secondary IP ranges.", "items": { "$ref": "UsableSubnetworkSecondaryRange" }, "type": "array" } }, "id": "UsableSubnetwork" }, "ListUsableSubnetworksResponse": { "properties": { "subnetworks": { "type": "array", "description": "A list of usable subnetworks in the specified network project.", "items": { "$ref": "UsableSubnetwork" } }, "nextPageToken": { "description": "This token allows you to get the next page of results for list requests. If the number of results is larger than `page_size`, use the `next_page_token` as a value for the query parameter `page_token` in the next request. The value will become empty when there are no more pages.", "type": "string" } }, "id": "ListUsableSubnetworksResponse", "type": "object", "description": "