 channel this configuration applies to.", "type": "string", "enumDescriptions": [ "No channel specified.", "RAPID channel is offered on an early access basis for customers who want to test new releases. WARNING: Versions available in the RAPID Channel may be subject to unresolved issues with no known workaround and are not subject to any SLAs.", "Clusters subscribed to REGULAR receive versions that are considered GA quality. REGULAR is intended for production users who want to take advantage of new features.", "Clusters subscribed to STABLE receive versions that are known to be stable and reliable in production." ] } }, "description": "ReleaseChannelConfig exposes configuration for a release channel.", "id": "ReleaseChannelConfig" }, "MeshCertificates": { "type": "object", "id": "MeshCertificates", "description": "Configuration for issuance of mTLS keys and certificates to Kubernetes pods.", "properties": { "enableCertificates": { "type": "boolean", "description": "enable_certificates controls issuance of workload mTLS certificates. If set, the GKE Workload Identity Certificates controller and node agent will be deployed in the cluster, which can then be configured by creating a WorkloadCertificateConfig Custom Resource. Requires Workload Identity (workload_pool must be non-empty)." } } }, "EphemeralStorageConfig": { "properties": { "localSsdCount": { "description": "Number of local SSDs to use to back ephemeral storage. Uses NVMe interfaces. Each local SSD is 375 GB in size. If zero, it means to disable using local SSDs as ephemeral storage.", "type": "integer", "format": "int32" } }, "type": "object", "description": "EphemeralStorageConfig contains configuration for the ephemeral storage filesystem.", "id": "EphemeralStorageConfig" }, "AuthenticatorGroupsConfig": { "properties": { "enabled": { "type": "boolean", "description": "Whether this cluster should return group membership lookups during authentication using a group of security groups." }, "securityGroup": {