." }, "network": { "description": "Output only. The relative name of the Google Compute Engine network(https://cloud.google.com/compute/docs/networks-and-firewalls#networks) to which the cluster is connected. Example: projects/my-project/global/networks/my-network", "type": "string" }, "privateIpv6GoogleAccess": { "type": "string", "description": "The desired state of IPv6 connectivity to Google Services. By default, no private IPv6 access to or from Google Services (all access will be via IPv4)", "enum": [ "PRIVATE_IPV6_GOOGLE_ACCESS_UNSPECIFIED", "PRIVATE_IPV6_GOOGLE_ACCESS_DISABLED", "PRIVATE_IPV6_GOOGLE_ACCESS_TO_GOOGLE", "PRIVATE_IPV6_GOOGLE_ACCESS_BIDIRECTIONAL" ], "enumDescriptions": [ "Default value. Same as DISABLED", "No private access to or from Google Services", "Enables private IPv6 access to Google Services from GKE", "Enables priate IPv6 access to and from Google Services" ] }, "datapathProvider": { "enumDescriptions": [ "Default value.", "Use the IPTables implementation based on kube-proxy.", "Use the eBPF based GKE Dataplane V2 with additional features. See the [GKE Dataplane V2 documentation](https://cloud.google.com/kubernetes-engine/docs/how-to/dataplane-v2) for more." ], "type": "string", "enum": [ "DATAPATH_PROVIDER_UNSPECIFIED", "LEGACY_DATAPATH", "ADVANCED_DATAPATH" ], "description": "The desired datapath provider for this cluster. By default, uses the IPTables-based kube-proxy implementation." } } }, "NodePoolAutoscaling": { "properties": { "maxNodeCount": { "description": "Maximum number of nodes for one location in the NodePool. Must be \u003e= min_node_count. There has to be enough quota to scale up the cluster.", "format": "int32", "type": "integer" }, "minNodeCount": { "format": "int32", "description": "Minimum number of nodes for one location in the NodePool. Must be \u003e= 1 and \u003c= max_node_count.", "type": "integer" }, "totalMaxNodeCount": { "type": "integer", "format": "int32", "description": "Maximum number of nodes in the node pool. Must be greater than total_min_node_count. There has to be enough quota to scale up the cluster. The total_*_node_count fields are mutually exclusive with the *_node_count fields." }, "totalMinNodeCount": { "type": "integer", "format": "int32", "description": "Minimum number of nodes in the node pool. Must be greater than 1 less than total_max_node_count. The total_*_node_count fields are mutually exclusive with the *_node_count fields." }, "enabled": { "description": "Is autoscaling enabled for this node pool.", "type": "boolean" }, "locationPolicy": { "enumDescriptions": [ "Not set.", "BALANCED is a best effort policy that aims to balance the sizes of different zones.", "ANY policy picks zones that have the highest capacity available." ], "description": "Location policy used when scaling up a nodepool.", "enum": [ "LOCATION_POLICY_UNSPECIFIED", "BALANCED", "ANY" ], "type": "string" }, "autoprovisioned": { "description": "Can this node pool be deleted automatically.", "type": "boolean" } }, "id": "NodePoolAutoscaling", "description": "NodePoolAutoscaling contains information required by cluster autoscaler to adjust the size of the node pool to the current cluster usage.", "type": "object" }, "ShieldedNodes": { "type": "object", "properties": { "enabled": { "type": "boolean", "description": "Whether Shielded Nodes features are enabled on all nodes in this cluster." } }, "description": "Configuration of Shielded Nodes feature.", "id": "ShieldedNodes" }, "AutoUpgradeOptions": { "id": "AutoUpgradeOptions", "properties": { "autoUpgradeStartTime": { "type": "string", "description": "[Output only] This field is set when upgrades are about to commence with the approximate start time for the upgrades, in [RFC3339](https://www.ietf.org/rfc/rfc3339.txt) text format." }, "description": { "description": "[Output only] This field is set when upgrades are about to commence with the description of the upgrade.", "type": "string" } }, "type": "object", "description": "Auto