gs.", "type": "object" }, "AcceleratorConfig": { "properties": { "gpuSharingConfig": { "description": "The configuration for GPU sharing options.", "$ref": "GPUSharingConfig" }, "maxTimeSharedClientsPerGpu": { "format": "int64", "type": "string", "description": "The number of time-shared GPU resources to expose for each physical GPU." }, "acceleratorType": { "type": "string", "description": "The accelerator type resource name. List of supported accelerators [here](https://cloud.google.com/compute/docs/gpus)" }, "acceleratorCount": { "description": "The number of the accelerator cards exposed to an instance.", "type": "string", "format": "int64" }, "gpuPartitionSize": { "type": "string", "description": "Size of partitions to create on the GPU. Valid values are described in the NVIDIA [mig user guide](https://docs.nvidia.com/datacenter/tesla/mig-user-guide/#partitioning)." } }, "id": "AcceleratorConfig", "type": "object", "description": "AcceleratorConfig represents a Hardware Accelerator request." }, "BinaryAuthorization": { "properties": { "enabled": { "type": "boolean", "description": "Enable Binary Authorization for this cluster. If enabled, all container images will be validated by Binary Authorization." }, "evaluationMode": { "type": "string", "description": "Mode of operation for binauthz policy evaluation. Currently the only options are equivalent to enable/disable. If unspecified, defaults to DISABLED.", "enumDescriptions": [ "Default value", "Disable BinaryAuthorization", "Enforce Kubernetes admission requests with BinaryAuthorization using the project's singleton policy. This is equivalent to setting the enabled boolean to true." ], "enum": [ "EVALUATION_MODE_UNSPECIFIED", "DISABLED", "PROJECT_SINGLETON_POLICY_ENFORCE" ] } }, "description": "Configuration for Binary Authorization.", "type": "object", "id": "BinaryAuthorization" }, "WorkloadIdentityConfig": { "type": "object", "properties": { "identityNamespace": { "description": "IAM Identity Namespace to attach all Kubernetes Service Accounts to.", "type": "string" }, "identityProvider": { "type": "string", "description": "identity provider is the third party identity provider." }, "workloadPool": { "description": "The workload pool to attach all Kubernetes service accounts to.", "type": "string" } }, "id": "WorkloadIdentityConfig", "description": "Configuration for the use of Kubernetes Service Accounts in GCP IAM policies." }, "ManagedPrometheusConfig": { "properties": { "enabled": { "description": "Enable Managed Collection.", "type": "boolean" } }, "description": "ManagedPrometheusConfig defines the configuration for Google Cloud Managed Service for Prometheus.", "type": "object", "id": "ManagedPrometheusConfig" }, "LoggingConfig": { "properties": { "componentConfig": { "description": "Logging components configuration", "$ref": "LoggingComponentConfig" } }, "id": "LoggingConfig", "type": "object", "description": "LoggingConfig is cluster logging configuration." }, "ResourceUsageExportConfig": { "id": "ResourceUsageExportConfig", "type": "object", "description": "Configuration for exporting cluster resource usages.", "properties": { "enableNetworkEgressMetering": { "type": "boolean", "description": "Whether to enable network egress metering for this cluster. If enabled, a daemonset will be created in the cluster to meter network egress traffic." }, "bigqueryDestination": { "$ref": "BigQueryDestination", "description": "Configuration to use BigQuery as usage export destination." }, "consumptionMeteringConfig": { "$ref": "ConsumptionMeteringConfig", "description": "Configuration to enable resource consumption metering." } } }, "IntraNodeVisibilityConfig": { "properties": { "enabled": { "type": "boolean", "description": "Enables intra node visibility for this cluster." } }, "type": "object", "description": "IntraNodeVisibilityConfig contains the desired config of the intra-node visibility on this cluster.", "id": "IntraNodeVisibilityConfig" }, "ClusterAutoscaling": {